import React from "react";
import Todo from './Todo'
const TodoList = ({todos}) => {
  return(
      <div className= 'todo-container'>
        <ul className='todo-list'>
            {todos.map(todo=>(
                <Todo todo = {text.id} text={todo.text}/>
            ))}
        </ul>
      </div>
  );
};

export default TodoList;
